text:
SENIOR COMPLIANCE OFFICER
Summary
Banking professional with more than 8.5 
years experience in banking with the strong knowledge of banking products, services and procedures,
especially in KYC/AML/CFT/OFAC/Global sanctions/FATCA compliance sphere, who can help your company to achieve any goals while
mitigating the risks.
Skill Highlights
Excellent verbal and written 
communication skills with strong interpersonal
skills;
Strong analytical and 
research skills;
Excellent 
team player, strong leadership abilities and team building skills;
Dynamic and self-motivated;
Creative and 
result-oriented;
Excellent organizational, project management and planning skills;
Ability to work well under 
pressure;
Adherence 
to deadlines;
Detail-oriented, multitask;
Reliable, responsible, 
conscientious, easy-going;
Demonstrated initiative and creativity in problem
solving;
Fast learner, eager for 
self-improvement.
Computer Skills
Proficiency with personal computers and pertinent mainframe systems and software packages, including MS Office Suite, AML/OFAC
monitoring software.
Languages
English (fluent), Russian (native), Belarusian (native), French (intermediate level (DELF B1), German (basic knowledge).
Professional Experience
Company Name

March 2013

to 
September 2015

Senior compliance officer

AML/CFT;
International Sanctions Compliance (mainly OFAC, FinCEN, European Union, Her Majesty's Treasury (HM Treasury), United Nations,
