The Bank Secrecy Act, The USA PATRIOT Act, US Treasury AML guidelines, OFAC requirements, and Suspicious Activity Reporting
requirements knowledge;
KYC/EDD/PEPs procedures;
Using in work Accuity, LexisNexis, WorldCompliance, WorldCheck, DowJones AML/CFT/KYC/Sanctions compliance solutions;
AML Risk Assessment, revising of work-with-clients' risk;
Processing/Analytics/Investigations of AML/CFT/KYC/Sanctions screening alerts on both the customer and transaction level;
Suspicious money laundering operations detection, monitoring and analysis by reviewing alerts generated by the automated monitoring
system, other sources;
Surveillance, account monitoring and investigating High-risk accounts and their transactions;
Effectively communicating with and obtaining information from account 
officers in order to support conclusions of customer activity reviews;
Preparing narrative comments that summarize results of reviews and that support decisions regarding activity analyzed;
Where appropriate, referring unusual or suspicious activity requiring further action to a supervisor;
Suspicious Activity Reports (SARs) writing, OFAC reporting;
Analysis and development of automation of AML/CFT/KYC/Sanctions compliance screening processes/business processes;
Contacting with foreign financial institutions, business correspondence, Â inquiries/investigations processing (English, Russian); 
AML/CFT/KYC/Sanctions training courses/presentations/consultings to the bank staff;
Other duties and special projects as assigned.
